/*
 * @lc app=leetcode id=3209 lang=cpp
 *
 * [3209] Number of Subarrays With AND Value of K
 *
 * https://leetcode.com/problems/number-of-subarrays-with-and-value-of-k/description/
 *
 * algorithms
 * Hard (21.75%)
 * Likes:    21
 * Dislikes: 2
 * Total Accepted:    4.6K
 * Total Submissions: 19.2K
 * Testcase Example:  '[1,1,1]\n1'
 *
 * Given an array of integers nums and an integer k, return the number of
 * subarrays of nums where the bitwise AND of the elements of the subarray
 * equals k.
 *
 *
 * Example 1:
 *
 *
 * Input: nums = [1,1,1], k = 1
 *
 * Output: 6
 *
 * Explanation:
 *
 * All subarrays contain only 1's.
 *
 *
 * Example 2:
 *
 *
 * Input: nums = [1,1,2], k = 1
 *
 * Output: 3
 *
 * Explanation:
 *
 * Subarrays having an AND value of 1 are: [1,1,2], [1,1,2], [1,1,2].
 *
 *
 * Example 3:
 *
 *
 * Input: nums = [1,2,3], k = 2
 *
 * Output: 2
 *
 * Explanation:
 *
 * Subarrays having an AND value of 2 are: [1,2,3], [1,2,3].
 *
 *
 *
 * Constraints:
 *
 *
 * 1 <= nums.length <= 10^5
 * 0 <= nums[i], k <= 10^9
 *
 *
 */
#include <bits/stdc++.h>
using namespace std;
// @lc code=start
class Solution
{
public:
    long long countSubarrays(vector<int> &nums, int k)
    {
        int n = (int)nums.size();
        int count = 0;

        for (int i = 0; i < n; i++)
        {
            int andResult = nums[i];
            for (int j = i; j < n; ++j)
            {
                andResult &= nums[j];
                if (andResult == k)
                {
                    ++count;
                }
                if (andResult < k)
                {
                    break;
                }
            }
        }

        return count;
    }
};
