    Solution sol;
    // Test_1
    vector<int> nums_1 = {1, 1, 1};
    int k_1 = 1;
    long long res_1 = sol.countSubarrays(nums_1, k_1);
    cout << res_1 << endl;
    assert(res_1 == 6);

    // Test_2
    vector<int> nums_2 = {1, 1, 2};
    int k_2 = 1;
    long long res_2 = sol.countSubarrays(nums_2, k_2);
    cout << res_2 << endl;
    assert(res_2 == 3);

